export const SignUpRequests = () => {
  const [signUpRequests, setSignUpRequests] = useState<SignUpRequest[]>([]);
  const [refetch, setRefetch] = useState(false);
  const [isLoading, setIsLoading] = useState(false);
  const { setRefetchAuthorsFlag } = useContext(AdminAuthorsContext);
  const { setAuthorRefetchFlag } = useContext(AuthorContext);

  useEffect(() => {
    const fetchSignUpRequests = async () => {
      const fetchedSignUpRequests = await getSignUpRequests();
      setSignUpRequests(fetchedSignUpRequests);
    };

    fetchSignUpRequests().catch();
  }, [refetch]);

  const onClickApproveRequest = async (requestId: string) => {
    setIsLoading(true);
    await approveSignUpRequest(requestId);
    setIsLoading(false);

    // Refetch
    setRefetch((prev) => !prev);
    setRefetchAuthorsFlag((prev: boolean) => !prev);
    setAuthorRefetchFlag((prev: boolean) => !prev);
  };

  if (isLoading) {
    return (
      <div className="spinner-container">
        <div className="spinner"></div>
      </div>
    );
  }

  if (signUpRequests.length == 0) {
    return (
      <div style={{ textAlign: "center" }}>
        <h2>No Sign Up Request</h2>
      </div>
    );
  }

  return (
    <Container style={{ marginTop: "15px", textAlign: "center" }}>
      <Grid
        container
        sx={{
          marginTop: "20px",
        }}
      >
        {signUpRequests.map((signUpRequest: SignUpRequest) => {
          return (
            <Grid
              key={signUpRequest.id}
              item
              xs={3}
              sx={{ marginBottom: "20px" }}
            >
              <AuthorSignUpDisplay
                key={signUpRequest.displayName}
                authorName={signUpRequest.displayName}
                onClickButton={() => onClickApproveRequest(signUpRequest.id)}
                buttonText="Approve Request"
              />
            </Grid>
          );
        })}
      </Grid>
    </Container>
  );
};

