import { useEffect, useState } from "react";
import { Author } from "../dataTypes";
import { getAuthor } from "../../service/authorService";
import AvatarIcon from "../../img/user.png";
import { getURL } from "../../service/services";

export const useFetchAuthor = (authorId: string) => {
  const [author, setAuthor] = useState<Author>();
  const [refetchFlag, setAuthorRefetchFlag] = useState(false);
  const [isAuthorFetching, setIsAuthorFetching] = useState(false);
  const [authorAvatar, setAuthorAvatar] = useState(AvatarIcon);

  useEffect(() => {
    const fetchData = async () => {
      setIsAuthorFetching(true);
      const fetchedAuthor = await getAuthor(authorId);
      try {
        const fetchedAuthorAvatar = await getURL(fetchedAuthor.profileImage);
        setAuthorAvatar(fetchedAuthorAvatar);
      } catch (error) {
        setAuthorAvatar(AvatarIcon);
      }
      setAuthor(fetchedAuthor);
      setIsAuthorFetching(false);
    };

    fetchData().catch();
  }, [refetchFlag]);

  return {
    author,
    setAuthor,
    setAuthorRefetchFlag,
    authorAvatar,
    setAuthorAvatar,
    isAuthorFetching,
  };
};

