export const Followers = () => {
  const [followers, setFollowers] = useState<Author[]>([]);
  const [refetchFollowersFlag, setRefetchFollowersFlag] =
    useState<boolean>(false);
  const { authorId } = useContext(AuthorContext);
  const [isAvatarFetching, setIsAvatarFetching] = useState(false);

  useEffect(() => {
    const fetchData = async () => {
      setIsAvatarFetching(true);
      const fetchedFollowers = await getFollowers(authorId);
      setFollowers(fetchedFollowers);
      setIsAvatarFetching(false);
    };

    fetchData().catch();
  }, [refetchFollowersFlag, authorId]);

  if (isAvatarFetching) return <LoadingPage />;

  return (
    <div style={{ textAlign: "center" }}>
      {followers.length > 0 ? (
        <Container
          style={{
            textAlign: "center",
            backgroundColor: "white",
            marginTop: "20px",
            borderRadius: "10px",
          }}
        >
          <Grid container>
            {followers.map((follower, idx) => (
              <Grid key={idx} item xs={6}>
                <Follower
                  key={follower.id}
                  follower={follower}
                  setRefetchFollowersFlag={setRefetchFollowersFlag}
                />
              </Grid>
            ))}
          </Grid>
        </Container>
      ) : (
        <h3>You don't have any followers</h3>
      )}
    </div>
  );
};

const Follower = ({
  follower,
  setRefetchFollowersFlag,
}: {
  follower: Author;
  setRefetchFollowersFlag: Function;
}) => {
  const { authorId } = useContext(AuthorContext);
  const [anchorEl, setAnchorEl] = useState(null);
  const [newAuthorAvatar, setNewAuthorAvatar] = useState(DefaultImage);

  const { data, isLoading, isError } = useQuery(follower.profileImage, () =>
    getURL(follower.profileImage)
  );

  const queryClient = useQueryClient();

  useEffect(() => {
    console.log(
      "Current React Query state:",
      follower.profileImage,
      queryClient.getQueryData(follower.profileImage)
    );
    if (isError) {
      setNewAuthorAvatar(DefaultImage);
    } else {
      setNewAuthorAvatar(data);
    }
  }, [data, isError]);

  const handleClick = (event: any) => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };

  const open = Boolean(anchorEl);
  const id = open ? "simple-popover" : undefined;

  const onClickRemoveFollower = async () => {
    const followerId = extractIdFromURL(follower.id);
    await removeFollower(authorId, followerId, follower.host);
    setRefetchFollowersFlag((prev: boolean) => !prev);
  };

  if (isLoading) return <LoadingPage />;

  return (
    <Grid
      container
      sx={{
        textAlign: "center",
        backgroundColor: "white",
        maxWidth: "500px",
        height: "150px",
        marginBottom: "10px",
        borderRadius: "15px",
        marginTop: "10px",
        border: "solid #ccc",
      }}
    >
      <Grid
        item
        xs={2.5}
        sx={{
          marginLeft: "10px",
          marginRight: "20px",
          display: "flex",
          alignItems: "center",
        }}
      >
        <img
          src={newAuthorAvatar}
          alt="Avatar"
          style={{
            maxWidth: "100%",
            maxHeight: "100%",
            objectFit: "contain",
            borderRadius: "10px",
            border: "solid #ccc",
          }}
        />
      </Grid>
      <Grid
        item
        xs={4}
        sx={{
          fontSize: "18px",
          display: "flex",
          alignItems: "center",
        }}
      >
        <ClickableAuthorName author={follower} />
      </Grid>
      <Grid
        item
        xs={4}
        sx={{
          marginTop: "50px",
          textAlign: "right",
        }}
      >
        <IconButton
          sx={{ p: 0, width: "30px", height: "30px" }}
          onClick={handleClick}
        >
          <b>...</b>
        </IconButton>
        <Popover
          id={id}
          open={open}
          anchorEl={anchorEl}
          onClose={handleClose}
          anchorOrigin={{
            vertical: "bottom",
            horizontal: "left",
          }}
        >
          <List component="nav">
            <ListItemButton onClick={onClickRemoveFollower}>
              <ListItemText primary="Remove Follower" />
            </ListItemButton>
          </List>
        </Popover>
      </Grid>
    </Grid>
  );
};

