export const LikeNotificationBox = ({ like }: { like: Like }) => {
  const [hover, setHover] = useState(false);
  const navigate = useNavigate();
  const isCommentLike = like.object.includes("comment");

  const onClickBox = () => {
    // TODO: extract host and refactor Post page to return post by host and id
    const processedLikeObject = like.object.split("/");
    const postId = isCommentLike
      ? processedLikeObject[processedLikeObject.length - 3]
      : processedLikeObject[processedLikeObject.length - 1];
    const route = `/post/${postId}`;
    navigate(route);
  };

  const {
    data: authorData,
    isLoading: isAuthorDataLoading,
    isError: isAuthorDataError,
  } = useQuery(like.author.id, () => getURL(like.author.id));

  const { data, isLoading, isError } = useQuery(
    authorData?.profileImage,
    () => getURL(authorData.profileImage),
    { enabled: !!authorData }
  );
  const [followerAvatar, setFollowerAvatar] = useState(AvatarIcon);

  useEffect(() => {
    if (!isError) {
      setFollowerAvatar(data);
    }
  }, [isError, data]);

  // if (isAuthorDataError) return <h4>Error fetching author data</h4>;

  if (isLoading || isAuthorDataLoading) return <LoadingPage />;

  return (
    <div
      onClick={onClickBox}
      onMouseEnter={() => setHover(true)}
      onMouseLeave={() => setHover(false)}
    >
      <Grid
        container
        spacing={2}
        sx={{
          background: hover ? "lightgray" : "white",
          justifyContent: "center",
          alignItems: "flex-start",
          textAlign: "left",
          width: "500px",
          height: "70px",
          // borderRadius: "10px",
        }}
      >
        <Grid item xs={1.2}>
          <Avatar src={followerAvatar} />
        </Grid>
        <Grid item xs={9}>
          <b>{like.author.displayName}</b> like a{" "}
          {isCommentLike ? "comment" : "post"}
        </Grid>
        <Grid item xs={1} sx={{ textAlign: "right" }}></Grid>
      </Grid>
    </div>
  );
};

import {
  Avatar,
  Button,
  Grid,
  IconButton,
  TextareaAutosize,
} from "@mui/material";
