const buttonStyle: any = {
  textTransform: "none",
  fontSize: "14px",
};

type CommentComponentProps = {
  post: Post;
  comment: Comment;
  postId: string;
};

export const CommentComponent = ({ comment, post }: CommentComponentProps) => {
  // TODO: fetch commenter avatar -> react query
  const { author } = useContext(AuthorContext);
  const { posts, setPosts } = useContext(PostContext);
  const isLiked = comment.likes.some((like) => like.author.id === author?.id);
  const [newAuthorAvatar, setNewAuthorAvatar] = useState(AvatarIcon);
  const { data, isError } = useQuery(
    comment.author.profileImage,
    () => getURL(comment.author.profileImage),
    { retry: 0 }
  );

  useEffect(() => {
    if (isError) {
      setNewAuthorAvatar(AvatarIcon);
    } else {
      setNewAuthorAvatar(data);
    }
  }, [data, isError]);

  const onClickLike = async () => {
    const inboxObject = {
      "@context": "",
      summary: `${author?.displayName} comment on this post`,
      type: "Like",
      author,
      object: comment.id,
    } as Like;

    // Send to the inbox of the owner of the post
    try {
      await sendInbox(
        extractIdFromURL(comment.author.id),
        inboxObject,
        comment.author.host
      );

      comment.likes = [...comment.likes, inboxObject];
      const updatedComments = post.comments.map((postComment) =>
        postComment.id === comment.id ? comment : postComment
      );
      const updatedPost = { ...post, comments: updatedComments };
      const updatedPosts = posts.map((storedPost) =>
        storedPost.id === updatedPost.id ? updatedPost : storedPost
      );
      setPosts(updatedPosts);
    } catch {
      // dont update like in store
      // already disable the like button
    }
  };

  return (
    <Grid container sx={{ marginBottom: "10px" }}>
      <Grid item xs={1} sx={{ marginRight: "10px" }}>
        <IconButton sx={{ p: 0 }}>
          <Avatar src={newAuthorAvatar} />
        </IconButton>
      </Grid>
      <Grid item xs={10.3}>
        <Grid
          item
          sx={{
            backgroundColor: "#e3e5e8",
            border: "solid #ccc",
            padding: "5px",
            borderRadius: "10px",
          }}
        >
          <Grid item xs={10} sx={{ textAlign: "left", marginBottom: "5px" }}>
            <ClickableAuthorName author={comment.author} />{" "}
          </Grid>
          <Grid item xs={10} sx={{ textAlign: "left" }}>
            {comment.comment}
          </Grid>
        </Grid>
        <Grid item xs="auto" sx={{ textAlign: "left" }}>
          <Grid container>
            <Grid item xs={2}>
              <Button
                style={buttonStyle}
                color="inherit"
                onClick={onClickLike}
                disabled={isLiked}
              >
                {isLiked ? (
                  <div style={{ color: blue[800], fontWeight: "bold" }}>
                    Liked
                  </div>
                ) : (
                  <>Like</>
                )}
              </Button>
            </Grid>
            <Grid item xs={2} sx={{ marginTop: "10px", fontSize: "14px" }}>
              {formatDateDifference(comment.published)}
            </Grid>
            <Grid item xs={8} sx={{ textAlign: "right", marginTop: "5px" }}>
