import { Avatar, Button, Grid, IconButton } from "@mui/material";
import { Author, Like } from "../data/dataTypes";
import { ModalWrapper } from "../reusable_components/ModalWrapper";
import { IconImage } from "../reusable_components/IconImage";
import CloseIcon from "../img/close.png";
import { ClickableAuthorName } from "../reusable_components/ClickableAuthorName";
import { useQuery } from "react-query";
import { getURL } from "../service/services";
import { LoadingPage } from "../reusable_components/LoadingPage";
import { InteractionAuthorDisplay } from "../reusable_components/InteractionAuthorDisplay";

export const LikeModal = ({
  likes,
  onClose,
}: {
  likes: Like[];
  onClose: Function;
}) => {
  const visitedAuthors = new Set<string>();
  const likeAuthors: Author[] = [];

  for (const like of likes) {
    if (!visitedAuthors.has(like.author.id)) {
      likeAuthors.push(like.author);
      visitedAuthors.add(like.author.id);
    }
  }

  return (
    <ModalWrapper>
      <Grid
        container
        sx={{
          borderBottom: "solid #ccc",
          marginBottom: "15px",
          minWidth: "500px",
          width: "100%",
        }}
      >
        <Grid item xs={11}>
          <h3>Liked Authors</h3>
        </Grid>
        <Grid item xs={1} sx={{ marginTop: "15px" }}>
          <IconButton onClick={() => onClose()}>
            <IconImage iconImage={CloseIcon} />
          </IconButton>
        </Grid>
      </Grid>
      <div>
        {likeAuthors.map((author, idx) => (
          <InteractionAuthorDisplay author={author} key={idx} />
        ))}
      </div>
    </ModalWrapper>
  );
};

import React, { useEffect, useState } from "react";
import { CONTENT_TYPE, Post } from "../data/dataTypes";
