import { useQuery } from "react-query";

type SharePostBoxProps = {
  post: Post;
};

export const SharePostBox = ({ post }: SharePostBoxProps) => {
  const [sharedPost, setSharedPost] = useState<Post>();
  const isSharedPost = sharedPost && sharedPost.origin !== sharedPost.source;
  const isImagePost =
    sharedPost &&
    (sharedPost.contentType === CONTENT_TYPE.JPEG ||
      sharedPost.contentType === CONTENT_TYPE.PNG);
  const { data, isError } = useQuery(post.origin, () => getURL(post.origin));

  useEffect(() => {
    if (!isError && data) {
      data.published = new Date(data.published
      setSharedPost(data);
    }
  }, [data, isError]);

  return (
    <Container
      style={{
        border: "solid lightgray",
        borderRadius: "15px",
        marginTop: "10px",
      }}
    >
      {!sharedPost ? (
        <h5>This post is no longer available</h5>
      ) : (
        <>
          <br />
          <AuthorRow
            post={sharedPost}
            authorId={extractIdFromURL(sharedPost.author.id)}
            setIsEditPostModalOpen={() => {}}
            noEditButton={true}
          />
          <Grid container sx={{ marginBottom: "10px", marginTop: "5px" }}>
            <Grid item xs={12} sx={{ fontSize: "18px" }} height={10}>
              <b>{sharedPost.title}</b>
            </Grid>
            <Grid item xs={12}>
              <p>
                <i>({sharedPost.description})</i>
              </p>
            </Grid>
            <Grid
              item
              xs={12}
              sx={{
                textIndent: "0",
                textAlign: "left",
                lineHeight: "1.35",
              }}
            >
              {isImagePost ? (
                <PhotoBox content={sharedPost.content} />
              ) : (
                <PostContentBox post={sharedPost} />
              )}
            </Grid>
            {isSharedPost ? (
              <Grid item xs={12}>
                <SharePostBox post={sharedPost} />
              </Grid>
            ) : null}
          </Grid>
        </>
      )}
    </Container>
  );
};

